// api/hooks/wishes.mock.ts
import { rest } from 'msw';

export const wishesMockHandler = [
  rest.post('/api/wishes', (req, res, ctx) => {
    const { productId } = req.body;

    return res(
      ctx.status(201),
      ctx.json({
        id: Math.floor(Math.random() * 1000), // 랜덤 id 생성
        productId,
      }),
    );
  }),

  rest.delete('/api/wishes/:wishId', (req, res, ctx) => {
    return res(ctx.status(204));
  }),

  rest.get('/api/wishes', (req, res, ctx) => {
    return res(
      ctx.json({
        content: [
          {
            id: 1,
            product: {
              id: 1,
              name: 'Product A',
              price: 100,
              imageUrl: 'http://example.com/product-a.jpg',
            },
          },
          {
            id: 2,
            product: {
              id: 2,
              name: 'Product B',
              price: 150,
              imageUrl: 'http://example.com/product-b.jpg',
            },
          },
        ],
        pageable: {
          sort: {
            sorted: true,
            unsorted: false,
            empty: false,
          },
          pageNumber: 0,
          pageSize: 10,
          offset: 0,
          unpaged: false,
          paged: true,
        },
        totalPages: 5,
        totalElements: 50,
        last: false,
        number: 0,
        size: 10,
        numberOfElements: 2,
        first: true,
        empty: false,
      }),
    );
  }),
];
